import React from 'react';
import DriverSessionData from './DriverSessionData';

const SessionDetails = ({ grandPrix }) => {
  return (
    <div className="session-details">
      <h2>{grandPrix.name}</h2>
      {grandPrix.events.map((event, index) => (
        <div key={index} className="event-container">
          <h3>{event.type}</h3>
          <p>Date: {event.date}</p>
          <p>Time: {event.time}</p>
          <DriverSessionData sessionData={event.sessionData} />
        </div>
      ))}
    </div>
  );
};

export default SessionDetails;
